parts:
{
  "name": "UBX-RXM-QZSSL6",
  "class_id": "0x02",
  "message_id": "0x73",
  "description": "QZSS L6 message",
  "message_type": "input",
  "payload": {
    "length": {
      "fixed": 264
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x01 for this version)"
      },
      {
        "name": "svId",
        "byte_offset": 1,
        "data_type": "U1",
        "description": "Satellite identifier (see Satellite Numbering)"
      },
      {
        "name": "cno",
        "byte_offset": 2,
        "data_type": "U2",
        "description": "Mean C/NO",
        "unit": "dBHz",
        "scale": {
          "raw": "2^-8",
          "multiplier": 0.00390625
        }
      },
      {
        "name": "timeTag",
        "byte_offset": 4,
        "data_type": "U4",
        "description": "Local time tag corresponding to the beginning of a received QZSS L6 message",
        "unit": "ms"
      },
      {
        "name": "groupDelay",
        "byte_offset": 8,
        "data_type": "U1",
        "description": "L6 group delay w.r.t. L2 on channel",
        "unit": "ns"
      },
      {
        "name": "bitErrCorr",
        "byte_offset": 9,
        "data_type": "U1",
        "description": "Number of bit errors corrected by Reed-Solomon decoder"
      },
      {
        "name": "chInfo",
        "byte_offset": 10,
        "data_type": "X2",
        "description": "Information about receiver channel associated with a received QZSS L6 message",
        "bitfield": {
          "bits": [
            {
              "name": "chn",
              "bit_start": 8,
              "bit_end": 9,
              "description": "Receiver channel (0, 1)"
            },
            {
              "name": "msgName",
              "bit_start": 10,
              "bit_end": 10,
              "description": "Message name, 0=L6D, 1=L6E"
            },
            {
              "name": "errStatus",
              "bit_start": 12,
              "bit_end": 13,
              "description": "Error status of the received QZSS L6 message: 0=unknown, 1=error-free, 2=erroneous"
            },
            {
              "name": "chName",
              "bit_start": 14,
              "bit_end": 15,
              "description": "Channel name, 0=channel A, 1=channel B"
            }
          ]
        }
      },
      {
        "name": "reserved0",
        "byte_offset": 12,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "msgBytes",
        "byte_offset": 14,
        "data_type": {
          "array_of": "U1",
          "count": 250
        },
        "description": "Bytes in a QZSS L6 message"
      }
    ]
  }
}
